import React from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';

const Dashboard = () => {

    return (
        <div>
            <nav>
                <Link>Home</Link>
                <Link>Portfolio</Link>
                <Link>Prices</Link>
                <Link>Rewards</Link>
                <Link>Notifications</Link>
            </nav>
            <div>
                <h1>Hi, Ruth!</h1>
                <p>Ready to buy your first crypto?</p>
            </div>
            <div>
                axios.get()
            </div>
        </div>
    )
}

export default Dashboard;
